const array = [
    {
        question: 'What is the best data structure ?',
        options: {
            a: 'LinkedList',
            b: 'Array',
            c: 'Stack',
            d: 'Queqe',
        },
        answer: 'b'
    },
    
    {
        question: 'What is the best programming language ?',
        options: {
            a: 'Python',
            b: 'Java',
            c: 'C',
            d: 'Javascript',
        },
        answer: 'd'
    }
    
]
